  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0108088 includes chemical,
  meteorological, physical and underway - surface data collected from L'ATALANTE in
  the Gulf of Guinea, North Atlantic Ocean and South Atlantic Ocean from 2006-05-26
  to 2006-07-05 and retrieved during cruise 35A320060526. These data include ALKALINITY,
  BAROMETRIC PRESSURE, CARBON DIOXIDE - AIR, DISSOLVED INORGANIC CARBON, DISSOLVED
  OXYGEN, Partial pressure (or fugacity) of carbon dioxide, SALINITY and SEA SURFACE
  TEMPERATURE. The instruments used to collect these data include Bubble type equilibrator
  for autonomous carbon dioxide (CO2) measurement and Carbon dioxide (CO2) gas analyzer.
  These data were collected by Nathalie Lefevre of Universite Pierre et Marie Curie;
  Institut Pierre Simon Laplace; Laboratoire D'Oceanographie et du Climat: Experimentations
  et Approches Numeriques as part of the EGEE-3 Line data set.nnThe Global Volunteer
  Observing Ship (VOS) Program is coordinated by the UNESCO International Ocean Carbon
  Coordination Project (IOCCP). International groups from 14 countries have been outfitting
  research ships and commercial vessels with automated CO2 sampling equipment to analyze
  the carbon exchange between the ocean and atmosphere.\",\n\t\"license_title\": null,\n\t\"extras\":
